// src/imagedb/imageDbService.ts
import axios13 from "axios";
var imageDbService = axios13.create({
  baseURL: IMAGE_SERVER_BASE_URL,
  timeout: 3e3
});

// src/imagedb/getImagesByWikidataId.ts
var getImagesByWikidataId = (numericId) => {
  return imageDbService.get(`/api/v1/image/info/wikidata/${numericId}`).then(({ images }) => {
    return images.map((dpImg) => {
      let descr = `${dpImg.uploadSite}
Image Database`;
      if (dpImg.comment) {
        descr += `
${dpImg.comment}`;
      }
      if (dpImg.recordedDate) {
        descr += `
Photo taken in ${dpImg.recordedDate.substr(0, 4)}`;
      }
      if (dpImg.sourceUrl) {
        descr += `

${dpImg.sourceUrl}`;
      }
      return {
        url: dpImg.url.transparent_face,
        urlByType: dpImg.url,
        title: descr,
        imageDb: true,
        sourceUrl: IMAGE_SERVER_BASE_URL + "/#/images/" + dpImg.id + "/show"
      };
    });
  });
};

// src/imagedb/getCreateMissingImagesLink.ts
var getCreateMissingImagesLink = (extra = {}) => {
  const params = new URLSearchParams({
    source: JSON.stringify(extra)
  });
  return IMAGE_SERVER_BASE_URL + "/#/images/create?" + params.toString();
};

// src/formatters/abbreviateNumber.ts
var abbreviateNumber = (value) => {
  let newValue = value;
  const suffixes = ["", "K", "M", "B", "T"];
  let suffixNum = 0;
  while (newValue >= 1e3) {
    newValue /= 1e3;
    suffixNum++;
  }
  newValue = newValue.toPrecision(3);
  newValue += suffixes[suffixNum];
  return newValue;
};

