// src/formatters/indonesia/nik.ts
var isValidNIK = (nik) => {
  if (nik.length !== 16) {
    return false;
  }
  return true;
};
var getDataFromNIK = (nik) => {
  if (!isValidNIK(nik)) {
    return null;
  }
  let districtCode = nik.slice(0, 2) + "." + nik.slice(2, 4) + "." + nik.slice(4, 6);
  let district = all_districts_default.find((entry) => entry.code === districtCode);
  let birthdateString = nik.slice(6, 12);
  let birthDate = birthdateString.replace(/(\d{2})(\d{2})(\d{2})/, "$3-$2-$1");
  return {
    district,
    birthDate,
    gender: parseInt(nik.slice(6, 7)) < 5 ? "male" : "female"
  };
};

// src/formatters/md5.ts
import { Md5 } from "ts-md5/dist/md5";
var md5 = (str) => {
  return Md5.hashStr(str);
};

// src/wikimedia-commons/getImageUrl.ts
function getCommonsRedirectUrlByFile(filename, size) {
  if (filename.includes("FilePath/")) {
    filename = filename.split("FilePath/")[1];
  }
  return `https://commons.wikimedia.org/wiki/Special:FilePath/${filename}?width=${size}px`;
}

// src/wikimedia-commons/getFilePath.ts
function getCommonsUrlByFile(file, width) {
  if (file.includes("FilePath/")) {
    file = file.split("FilePath/")[1];
    file = decodeURIComponent(file);
  }
  file = file.replace(/^File:/, "").replace(/\s+/g, "_");
  const encoded = encodeURIComponent(file);
  const base = "https://upload.wikimedia.org/wikipedia/commons";
  const hash = md5(file);
  const ns = `${hash[0]}/${hash[0]}${hash[1]}`;
  if (width) {
    const suffix = file.match(/tiff?$/i) ? ".jpg" : file.match(/svg$/i) ? ".png" : "";
    return `${base}/thumb/${ns}/${encoded}/${width}px-${encoded}${suffix}`;
  } else {
    return `${base}/${ns}/${encoded}`;
  }
}
